}

configure_settings(){
   if [ -f ${SETTINGS_SAVE} ]; then
      echo '################################'
      echo 'RESTORE SETTINGS'
      echo '################################'
   else
      echo '################################'
      echo 'CONFIGURE SETTINGS'
      echo '################################'
   fi

   sed="sudo -u ${RTKBASE_USER} sed -i"
   #echo sed=${sed}

   #echo BASEDIR=${BASEDIR} RTKBASE_PATH=${RTKBASE_PATH}
   if [[ "${BASEDIR}" != "${RTKBASE_PATH}" ]]
   then
      #echo mv ${BASEDIR}/${UNICORE_SETTIGNS} ${RTKBASE_PATH}/
      mv ${BASEDIR}/${UNICORE_SETTIGNS} ${RTKBASE_PATH}/
      ExitCodeCheck $?
   fi
   #echo chmod +x ${RTKBASE_PATH}/${UNICORE_SETTIGNS}
   chmod +x ${RTKBASE_PATH}/${UNICORE_SETTIGNS}
   ExitCodeCheck $?

   if [ -f ${SETTINGS_SAVE} ]; then
      #echo sudo -u "${RTKBASE_USER}" mv ${SETTINGS_SAVE} ${SETTINGS_NOW}
      sudo -u "${RTKBASE_USER}" mv ${SETTINGS_SAVE} ${SETTINGS_NOW}
      ExitCodeCheck $?

      source <( grep -v '^#' "${SETTINGS_DEFAULT}" | grep 'version=' )
      #echo version=${version} VERSION=${VERSION}
      ${sed} s/^version=.*/version=${version}/ "${SETTINGS_NOW}"
      ExitCodeCheck $?

      #echo if ! grep -q "^mobile_modem_web_ip=" "${SETTINGS_NOW}"; then
      if ! grep -q "^mobile_modem_web_ip=" "${SETTINGS_NOW}"; then
         echo insert mobile_modem_web_ip and mobile_modem_web_proxy_port into ${SETTINGS_NOW}
         #echo ${sed} "/^gnss_rcv_web_proxy_port=/a #ip address of the integrated modem web service (ie on E3372-325)\nmobile_modem_web_ip=192.168.8.1\n#port number for the Flask proxy app used to display the modem web service\nmobile_modem_web_proxy_port=7070" "${SETTINGS_NOW}"
         ${sed} "/^gnss_rcv_web_proxy_port=/a #ip address of the integrated modem web service (ie on E3372-325)\nmobile_modem_web_ip=192.168.8.1\n#port number for the Flask proxy app used to display the modem web service\nmobile_modem_web_proxy_port=7070" "${SETTINGS_NOW}"
         ExitCodeCheck $?
      fi

      #echo ${RTKBASE_PATH}/${UNICORE_SETTIGNS} ${OLD_VERSION}
      ${RTKBASE_PATH}/${UNICORE_SETTIGNS} ${OLD_VERSION}
      ExitCodeCheck $?
   else
      #echo ${RTKBASE_PATH}/${UNICORE_SETTIGNS}
      ${RTKBASE_PATH}/${UNICORE_SETTIGNS}
      ExitCodeCheck $?
   fi
   #echo rm -f ${RTKBASE_PATH}/${UNICORE_SETTIGNS}
   rm -f ${RTKBASE_PATH}/${UNICORE_SETTIGNS}
}

configure_gnss(){
   UP_TIME=`cat /proc/uptime | sed "s/\..*$//"`
   LIMIT_TIME=40
   LEFT_TIME=`expr ${LIMIT_TIME} - ${UP_TIME}`
   #echo UP_TIME=${UP_TIME} LIMIT_TIME=${LIMIT_TIME} LEFT_TIME=${LEFT_TIME}
   if [[ ${LEFT_TIME} -gt 0 ]]; then
      #echo sleep ${LEFT_TIME}
      sleep ${LEFT_TIME}
   fi

   rtkbase_path=${RTKBASE_GIT}
   #echo source "${rtkbase_path}/tools/opizero_temp_offset.sh"
   source "${rtkbase_path}/tools/opizero_temp_offset.sh"
   ExitCodeCheck $?

   HAVE_TTYUSB=`find /dev/ttyUSB* 2>/dev/null`
   HAVE_TTYACM=`find /dev/ttyACM* 2>/dev/null`
   HAVE_TTYAMA=`find /dev/ttyAMA* 2>/dev/null`
   #echo HAVE_TTYUSB=${HAVE_TTYUSB} HAVE_TTYACM=${HAVE_TTYACM} HAVE_TTYAMA=${HAVE_TTYAMA} RECVPORT=${RECVPORT}
   if [[ "${HAVE_TTYUSB}" == "" ]] && [[ "${HAVE_TTYACM}" == "" ]] && [[ "${HAVE_TTYAMA}" == "" ]] && [[ ! -c "${RECVPORT}" ]]; then
      echo 'No any ports for GNSS receiver. We can'\''t detect and configure.'
      ExitCodeCheck 1
   else
      if [[ "${UPDATE}" != "Y" ]] || ! have_full; then
         for i in `seq 1 3`; do
            #echo ${RTKBASE_TOOLS}/${UNICORE_CONFIGURE} -u ${RTKBASE_USER} -e
            ${RTKBASE_TOOLS}/${UNICORE_CONFIGURE} -u ${RTKBASE_USER} -e
            ExitCodeCheck $?
            if [[ $lastcode == 0 ]]; then
               break;
            fi
         done
      fi

      source <( grep '^com_port=' "${rtkbase_path}"/settings.conf ) #import settings
      if [[ "${com_port}" == "" ]]; then
         echo 'GNSS receiver is not specified. We can'\''t configure.'
         ExitCodeCheck 1
      else
         for i in `seq 1 3`; do
            #echo ${RTKBASE_TOOLS}/${UNICORE_CONFIGURE} -u ${RTKBASE_USER} -c
            ${RTKBASE_TOOLS}/${UNICORE_CONFIGURE} -u ${RTKBASE_USER} -c
            ExitCodeCheck $?
            if [[ $lastcode == 0 ]]; then
               break;
            fi
         done
      fi
   fi

   restart_rtkbase_if_started
}

start_rtkbase_services(){
  #echo ${RTKBASE_TOOLS}/insall.sh -u ${RTKBASE_USER} -s
  ${RTKBASE_TOOLS}/install.sh -u ${RTKBASE_USER} -s
  ExitCodeCheck $?

  source <( grep '^receiver=' "${SETTINGS_NOW}" ) #import settings
  ExitCodeCheck $?
  #echo receiver=${receiver}

  DHCP_enabled=$(systemctl is-enabled "${DHCP_SERVICE}")
  [[ "${DHCP_enabled}" != "disabled" ]] && [[ "${DHCP_enabled}" != "masked" ]] && systemctl disable "${DHCP_SERVICE}"

  GNSS_WEB_PROXY=rtkbase_gnss_web_proxy.service
  if [[ "${receiver}" =~ Septentrio ]]; then
     #echo systemctl start "${DHCP_SERVICE}"
     systemctl start "${DHCP_SERVICE}"
     ExitCodeCheck $?

     #echo systemctl enable --now "${SEPTENTRIO_NAT_SERVICE}"
     systemctl enable --now "${SEPTENTRIO_NAT_SERVICE}"
     ExitCodeCheck $?

     #echo systemctl enable --now "${GNSS_WEB_PROXY}"
     systemctl enable --now "${GNSS_WEB_PROXY}"
     ExitCodeCheck $?
  fi

  MOBILE=/sys/class/net/mobile
  if [[ -L ${MOBILE} ]]; then
     #echo systemctl enable --now "${MODEM_WEB_PROXY_SERVICE}"
     systemctl enable --now "${MODEM_WEB_PROXY_SERVICE}"
     ExitCodeCheck $?
  fi

  #echo systemctl start "${CHECK_INTERNET_SERVICE}"
  systemctl start "${CHECK_INTERNET_SERVICE}"
  ExitCodeCheck $?
  HAVE_ELT0x33=`find -P /dev/serial/by-id -name "*ELT0x33*" 2>/dev/null`
  if [[ "${HAVE_ELT0x33}" != "" ]]; then
     #echo systemctl start "${CHECK_SATELITES_SERVICE}"
     systemctl start "${CHECK_SATELITES_SERVICE}"
     ExitCodeCheck $?
  fi
}

delete_garbage(){
   if [[ "${FILES_DELETE}" != "" ]]
   then
      echo '################################'
      echo 'DELETE GARBAGE'
      echo '################################'

      #echo rm -f ${FILES_DELETE}
      rm -f ${FILES_DELETE}
      #echo \[ $exitcode = 0 \] \&\& have_receiver \&\& echo rm -f ${BASENAME}
   fi
   [ $exitcode = 0 ] && have_receiver && rm -f ${BASENAME}
}

info_open(){
   NOW_HOST=`hostname`
   if [ $exitcode = 0 ]
   then
      echo You can open your browser to http://${NOW_HOST}.local into local network
   else
      echo exitcode = $exitcode Check bugs in this output
   fi
}

info_bug(){
   if [ $exitcode != 0 ]
   then
      echo exitcode = $exitcode Check bugs in this output
   fi
}

